import React from 'react'
import img from './img/first.png';


const Card = () => {
    return (
        <>
           <div className="container">
               <div className="row">
                   <div className="col-lg-4 col-md-6 col-sm-12 mt-5">
                       <div className="card">
                           <img src={img} alt="random image" width="200" height="200" className="ig-card"/>

                       </div>
                   </div>
               </div>
           </div> 
        </>
    )
}

export default Card;
